CREATE TABLE m_lesson_animation(
  lesson_menu_id INTEGER NOT NULL,
  member_id INTEGER NOT NULL,
  normal_emotion TEXT NOT NULL,
  flash_emotion TEXT NOT NULL,
  special_flash_emotion TEXT NOT NULL,
  rank_up_emotion TEXT NOT NULL,
  special_rank_up_emotion TEXT NOT NULL,
  PRIMARY KEY (lesson_menu_id, member_id),
  FOREIGN KEY (lesson_menu_id) REFERENCES m_lesson_menu(id),
  FOREIGN KEY (member_id) REFERENCES m_member(id)
);
